        <img src={gmIcon} alt="gmIcon" />
      </a> */}
    </ContactsIcons>
  );
}

const ContactsIcons = styled.div`
  display: flex;
  align-items: flex-end;
  justify-content: center;
  gap: 16px;
  position: sticky;
  top: 16px;
  height: 112px;
  z-index: 1;
  & img {
    width: 32px;
    padding-bottom: 16px;
  }
  @media screen and (max-width: 464px) {
    position: unset;
  }
`;
